const list=document.querySelector('#box');
const searchBar = document.forms['search-books'];
const value= searchBar.querySelector('input');
 searchBar.addEventListener('submit',function(e){
     e.preventDefault();
     const term = searchBar.querySelector('input').value.toLowerCase();
     const users=list.getElementsByClassName('users');
     //console.log(users);
     Array.from(users).forEach(function(book){
         const title=book.querySelector('p').innerText;
         if(title.toLowerCase().indexOf(term)!=-1){
             book.style.display='block';
         }else{
             book.style.display = 'none';
         }
     })
 });